INSERT INTO `blog_posts` VALUES (1,1,1,'{\"en\": \"test\", \"fr\": \"test\"}','{\"en\": \"test\", \"fr\": \"test\"}','{\"en\": \"test\", \"fr\": \"test\"}','{\"en\": \"test\", \"fr\": \"test\"}','blog/IUbWywRfAn0HurwW1bS00Ksg3TxmXWkCdmbU48WS.jpg',1,'2025-11-02 01:24:47','{\"en\": \"\", \"fr\": \"\"}','{\"en\": \"\", \"fr\": \"\"}',51,'2025-11-02 01:05:07','2025-11-02 01:27:43',NULL),(2,NULL,2,'{\"en\": \"CAMBODIA\", \"fr\": \"CAMBODIA\"}','{\"en\": \"cambodia\", \"fr\": \"cambodia\"}','{\"en\": \"Cambodia is a beautiful country\", \"fr\": \"\"}','{\"en\": \"Cambodia is a beautiful country with a long history and a strong culture, located on the Indochinese mainland of Southeast Asia, is a land of plains and rivers that lies amid important overland and river trade routes linking China to India and Southeast Asia. Cambodia was once the center of the great Khmer Empire (9th- 15th century), which built Angkor Wat and many other temples.\\r\\nSiem Reap is the most popular city for tourists, that surrounded by ancient Temples. As Angkor Wat is a symbol of Cambodia heart, history and identity, was built in the early 12th century by King Suryavarman II as a Hindu temple dedicated to the God Vishnu. Even though it is almost 900 years old, the temple is still strong. Angkor Wat and the whole Angkor Archaeological Park were added to the UNESCO World Heritage List in 1992.\\r\\nAdditionally, the best views of Sunrise in the early morning at Angkor Wat temple like magical that make the sky pink and gold. The temple reflection shimmers in the lotus pond in front. On the top of that, Sunset at Phnom Bakheng is also the perfect place and the best view for enjoying with a magical experience and unforgettable.\\r\\nMore than Angkor Wat Temple, Siem Reap also has many ancient temples to explore history, culture and nature as Bayon Temple, Ta Prohm Temple, Banteay Srey Temple, Banteay Kdei Temple, Preas Khan Temple, Neak Pean Temple, Ta Keo Temple, Prasat Kravan Temple, ... etc.\", \"fr\": \"Cambodia is a beautiful country with a long history and a strong culture, located on the Indochinese mainland of Southeast Asia, is a land of plains and rivers that lies amid important overland and river trade routes linking China to India and Southeast Asia. Cambodia was once the center of the great Khmer Empire (9th- 15th century), which built Angkor Wat and many other temples.\\r\\nSiem Reap is the most popular city for tourists, that surrounded by ancient Temples. As Angkor Wat is a symbol of Cambodia heart, history and identity, was built in the early 12th century by King Suryavarman II as a Hindu temple dedicated to the God Vishnu. Even though it is almost 900 years old, the temple is still strong. Angkor Wat and the whole Angkor Archaeological Park were added to the UNESCO World Heritage List in 1992.\\r\\nAdditionally, the best views of Sunrise in the early morning at Angkor Wat temple like magical that make the sky pink and gold. The temple reflection shimmers in the lotus pond in front. On the top of that, Sunset at Phnom Bakheng is also the perfect place and the best view for enjoying with a magical experience and unforgettable.\\r\\nMore than Angkor Wat Temple, Siem Reap also has many ancient temples to explore history, culture and nature as Bayon Temple, Ta Prohm Temple, Banteay Srey Temple, Banteay Kdei Temple, Preas Khan Temple, Neak Pean Temple, Ta Keo Temple, Prasat Kravan Temple, ... etc.\"}','blog/SiFFM4DfIVRbXfJKOH0jspDqQ7C6AL8wJ9AfhOyb.png',1,'2025-11-10 02:12:09','{\"en\": \"\", \"fr\": \"\"}','{\"en\": \"\", \"fr\": \"\"}',56,'2025-11-10 02:12:09','2025-11-10 02:12:09',NULL);
