INSERT INTO `products` VALUES (1,'EANBYJ8TUEI17','{\"en\": \"Cambodia Map provinces on stand (20 x 17cm)\", \"fr\": \"Cambodia Map provinces on stand (20 x 17cm)\"}','{\"en\": \"We create high-quality Cambodia map displays designed for office, décor, and presentation use. Our products include detailed provincial maps in compact and elegant formats. We create high-quality Cambodia map displays designed for office, décor, and presentation use. Our products include detailed provincial maps in compact and elegant formats\", \"fr\": \"Nous créons des présentoirs de cartes du Cambodge de haute qualité, conçus pour les bureaux, la décoration et les présentations. Nos produits incluent des cartes provinciales détaillées dans des formats compacts et élégants. Nous créons des présentoirs de cartes du Cambodge de haute qualité, conçus pour les bureaux, la décoration et les présentations. Nos produits incluent des cartes provinciales détaillées dans des formats compacts et élégants.\"}','{\"en\": \"cambodia-map-provinces-on-stand-20-x-17cm\", \"fr\": \"cambodia-map-provinces-on-stand-20-x-17cm\"}',15.00,9.75,1,NULL,NULL,1,0,1,0,NULL,'2025-11-02 01:02:43','2025-11-28 09:07:14'),(2,'EANSVFYLPEN4L','{\"en\": \"Cambodia Map puzzle (20 x 17cm)\", \"fr\": \"Cambodia Map puzzle (20 x 17cm)\"}','{\"en\": \"Discover Cambodia piece by piece. This compact map puzzle features all provinces of Cambodia with clear borders and labeling, making it both fun and educational. Designed for quick assembly, it’s ideal for students, travelers, and anyone who loves Cambodian geography. Its small format makes it perfect for gifts, souvenirs, offices, or classroom use.\", \"fr\": \"Découvrez le Cambodge pièce par pièce. Ce puzzle cartographique compact présente toutes les provinces du pays avec des frontières claires et une lisibilité optimale, offrant un jeu à la fois ludique et éducatif. Conçu pour un assemblage rapide, il est idéal pour les étudiants, les voyageurs et tous les passionnés de géographie cambodgienne. Son petit format le rend parfait comme cadeau, souvenir, pour le bureau ou pour une utilisation en classe.\"}','{\"en\": \"cambodia-map-puzzle-20-x-17cm\", \"fr\": \"cambodia-map-puzzle-20-x-17cm\"}',15.00,9.75,1,NULL,NULL,1,0,1,0,NULL,'2025-11-02 01:02:43','2025-11-28 09:19:23'),(3,'EANZLAGT6M3MB','{\"en\": \"Cambodia Map provinces  (60 x 40cm)\", \"fr\": \"Cambodia Map provinces  (60 x 40cm)\"}','{\"en\": \"Explore Cambodia in detail with this large-format provincial map. Featuring clearly defined borders, province names, major cities, and key geographical features, this map offers both visual clarity and educational value. Its 60 × 40 cm size makes it perfect for wall display in offices, schools, government institutions, travel agencies, and homes.\", \"fr\": \"Explorez le Cambodge en détail avec cette carte provinciale au format généreux. Affichant clairement les frontières, les noms des provinces, les principales villes et les éléments géographiques importants, elle offre à la fois précision visuelle et valeur éducative. Ses dimensions 60 × 40 cm en font un excellent support mural pour les bureaux, écoles, institutions publiques, agences de voyage ou même la maison.\"}','{\"en\": \"cambodia-map-provinces-60-x-40cm\", \"fr\": \"cambodia-map-provinces-60-x-40cm\"}',40.00,26.00,1,NULL,NULL,1,0,1,0,NULL,'2025-11-02 01:02:43','2025-11-28 09:24:01'),(4,'EANHVSQQSMX2N','{\"en\": \"Vintage Cambodia Map french (48x40cm)\", \"fr\": \"Vintage Cambodia Map french (48x40cm)\"}','{\"en\": \"Add a touch of history and character with this vintage-style map of Cambodia. Designed with an antique look, it highlights the provinces and borders of the country in a classic, aged aesthetic. Warm tones and retro detailing make it a standout decorative piece for anyone who appreciates culture, heritage, and timeless design.\", \"fr\": \"Ajoutez une touche d’histoire et d’élégance avec cette carte vintage du Cambodge. Inspirée des styles anciens, elle met en valeur les provinces et les contours du pays dans une esthétique rétro chaleureuse. Ses teintes vieillies et son design classique en font un objet décoratif unique, idéal pour ceux qui apprécient la culture, l’histoire et le charme du passé.\"}','{\"en\": \"vintage-cambodia-map-french-48x40cm\", \"fr\": \"vintage-cambodia-map-french-48x40cm\"}',35.00,22.75,1,NULL,NULL,1,0,1,0,NULL,'2025-11-02 01:02:43','2025-11-28 09:25:39'),(5,'EANMXHTB3JDV4','{\"en\": \"Cambodia Map provinces  (160x85cm)\", \"fr\": \"Cambodia Map provinces  (160x85cm)\"}','{\"en\": \"A large-format wall map designed to showcase Cambodia with clarity and precision. This oversized map features all provincial boundaries, major cities, key road networks, and geographical details, making it ideal for professional and educational use. Its 160 × 85 cm scale provides excellent visibility, perfect for presentation spaces, classrooms, offices, meeting rooms, and public environments.\", \"fr\": \"Une carte murale grand format conçue pour afficher le Cambodge avec clarté et précision. Cette carte XXL présente toutes les limites provinciales, les principales villes, les réseaux routiers et divers éléments géographiques, ce qui en fait un outil idéal pour un usage éducatif et professionnel. Son format 160 × 85 cm garantit une excellente visibilité, parfaite pour les salles de cours, bureaux, salles de réunion et espaces publics.\"}','{\"en\": \"cambodia-map-provinces-160x85cm\", \"fr\": \"cambodia-map-provinces-160x85cm\"}',150.00,97.50,1,NULL,NULL,1,0,1,0,NULL,'2025-11-02 01:02:43','2025-11-28 09:27:01'),(6,'EANACJWBDP72A','{\"en\": \"Travel game box\", \"fr\": \"Travel game box\"}','{\"en\": \"Take fun wherever you go. This compact Travel Game Box is designed for adventure, convenience, and entertainment on the move. Lightweight, durable, and easy to carry, it includes engaging games suitable for family, friends, or solo play. Perfect for road trips, flights, holidays, school outings, cafés, or weekend getaways.\", \"fr\"