CREATE TABLE `stock_batches` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `product_id` bigint unsigned NOT NULL,
  `reseller_id` bigint unsigned DEFAULT NULL,
  `store_id` bigint unsigned DEFAULT NULL,
  `quantity` int NOT NULL DEFAULT '0',
  `unit_price` decimal(12,2) NOT NULL DEFAULT '0.00',
  `source_delivery_id` bigint unsigned DEFAULT NULL,
  `source_refill_id` bigint unsigned DEFAULT NULL,
  `source_production_id` bigint unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `source_supplier_order_id` bigint unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `stock_batches_product_id_foreign` (`product_id`),
  KEY `stock_batches_reseller_id_foreign` (`reseller_id`),
  KEY `stock_batches_store_id_foreign` (`store_id`),
  KEY `stock_batches_source_delivery_id_foreign` (`source_delivery_id`),
  KEY `stock_batches_source_supplier_order_id_foreign` (`source_supplier_order_id`),
  KEY `stock_batches_source_production_id_foreign` (`source_production_id`),
  CONSTRAINT `stock_batches_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE,
  CONSTRAINT `stock_batches_reseller_id_foreign` FOREIGN KEY (`reseller_id`) REFERENCES `resellers` (`id`) ON DELETE CASCADE,
  CONSTRAINT `stock_batches_source_delivery_id_foreign` FOREIGN KEY (`source_delivery_id`) REFERENCES `reseller_stock_deliveries` (`id`) ON DELETE CASCADE,
  CONSTRAINT `stock_batches_source_production_id_foreign` FOREIGN KEY (`source_production_id`) REFERENCES `productions` (`id`) ON DELETE SET NULL,
  CONSTRAINT `stock_batches_source_supplier_order_id_foreign` FOREIGN KEY (`source_supplier_order_id`) REFERENCES `supplier_orders` (`id`) ON DELETE CASCADE,
  CONSTRAINT `stock_batches_store_id_foreign` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2510 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
